import React, { Component } from 'react';
import {
    CardElement,
    injectStripe,
    Elements,
    StripeProvider
} from 'react-stripe-elements';
import { Button, Container } from 'semantic-ui-react';

class CheckoutForm extends Component {
    constructor(props) {
        super(props);
        this.submit = this.submit.bind(this);
    }

    async submit(ev) {

    }

    render() {
        return (
            <div>
                <p> Would you like to complete your puchase?</p>
                <CardElement />
                <Button onClick={this.submit} primary style={{ marginTop: "10px" }}>
                    Submit
                </Button>
            </div>
        );
    }
}


const InjectedForm = injectStripe(CheckoutForm);

const WrappedForm = () => (
    <Container text>
        <StripeProvider apiKey="pk_test_12345">
            <div className="example">
                <h1>React Stripe Elements</h1>
                <Elements>
                    <InjectedForm />
                </Elements>

            </div>

        </StripeProvider>
    </Container>

);

export default WrappedForm;
